        public static List<KeyValuePair<SpawnBaseTypes, BaseTemplate>> ReturnAllCommunityStored(bool reloadPublic)
        {
            List<KeyValuePair<SpawnBaseTypes, BaseTemplate>> batch = new List<KeyValuePair<SpawnBaseTypes, BaseTemplate>>();

            // Add Bases
            batch.AddRange(ComHarvests);
            batch.AddRange(ComProducts);
            batch.AddRange(ComHQs);

            // Add Mobile
            batch.AddRange(ComLand);
            batch.AddRange(ComSeas);
            batch.AddRange(ComAirs);
            batch.AddRange(ComSpaces);

            if (reloadPublic)
                CommunityCluster.LoadPublicFromFile();
            List<SpawnBaseTypes> tempSearch = new List<SpawnBaseTypes>();
            batch.ForEach(delegate (KeyValuePair<SpawnBaseTypes, BaseTemplate> cand) { tempSearch.Add(cand.Key); });
            // batch exporting is messy and will result in overlaps!
            foreach (KeyValuePair<SpawnBaseTypes, BaseTemplate> pair in CommunityCluster.ClusterF)
            {
                try
                {
                    if (!tempSearch.Contains(pair.Key))
                    {
                        batch.Add(pair);
                        tempSearch.Add(pair.Key);
                    }
                }
                catch { }
            }

            return batch;
        }

        public static void UnloadRemainingUnused()
        {
            CommunityCluster.ClusterF.Clear();
            ComHarvests.Clear();
            ComProducts.Clear();
            ComHQs.Clear();
            ComLand.Clear(); 
            ComSeas.Clear();
            ComAirs.Clear();
            ComSpaces.Clear();
        }
